import React, { useState , useEffect} from 'react'

export default function Comp() {
    const [s,setS] = useState([])
    
    useEffect(()=>{
        try{
            fetch('https://jsonplaceholder.typicode.com/users')
            .then(res=>{
                console.log('ok')
                console.log(res)
            })
        }catch(e){
            console.log(e);
        }
    },[])

    return (
        <div>
            hello
        </div>
    )
}
